import React from "react";
// import { NavLink } from "react-router-dom";
import { NavHashLink as NavLink } from "react-router-hash-link";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/spaceship.gif";
const CommonParent = (props) => {
  return (
    <section id="header" className="d-flex align-items-center">
      <div className="container-fluid">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row">
              <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                {props.name}
                {props.text}

                <div className="mt-3">
                  <NavLink smooth to={props.visit1} className="btn-get-started">
                    {props.btname1}
                  </NavLink>

                  <NavLink smooth to={props.visit2} className="btn-get-started">
                    {props.btname2}
                  </NavLink>
                </div>
              </div>

              <div className="col-lg-6 order-1 order-lg-2 header-img ">
                <img
                  src={props.imgsrc}
                  className="image-fluid animated responsive img"
                  alt="CommonParent img"
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default CommonParent;
